import React, {Component} from 'react'
import Layout from "../_layouts/default/Layout";
import Typography from "@material-ui/core/Typography";
import Grid from "@material-ui/core/Grid";

class CompositionsPage extends Component {
    render() {
        return (
            <Layout>
                <Typography variant="h5" gutterBottom>Compositions</Typography>
                <Grid container justify="center" spacing={24}>
                    <Grid item md={3}>
                        composition
                    </Grid>
                    <Grid item md={3}>
                        composition
                    </Grid>
                    <Grid item md={3}>
                        composition
                    </Grid>
                    <Grid item md={3}>
                        composition
                    </Grid>
                </Grid>
                <div>Pager</div>
            </Layout>
        )
    }
}

export default CompositionsPage
